<html xmlns:f="http://typo3.org/ns/TYPO3/CMS/Fluid/ViewHelpers" data-namespace-typo3-fluid="true">
	<f:layout name="Slickcontent" />
	<f:section name="Main">
		<f:cObject typoscriptObjectPath="lib.slick.tx_slick_pages" data="{data}"/>
		<f:format.raw>{shortcuts}</f:format.raw>
	</f:section>
	<f:media class="image-embed-item" file="{file}" width="{dimensions.width}" height="{dimensions.height}" alt="{file.alternative}" title="{file.title}" loading="{settings.media.lazyLoading}"/>

	<f:comment>#i0053</f:comment>
	<f:debug>{_all}</f:debug>
	<f:debug>{test9}</f:debug>
	<f:debug>{test10}</f:debug>
</html>
